function renderGoogleChart(e,a,t){let r=document.querySelector("."+e);google.charts.load("current",{packages:["corechart","bar"]}),google.charts.setOnLoadCallback(()=>{t.then(t=>{let o=[["Pašvaldība","Studentu skaits","Procentuālais daudzums"]];t.labels.forEach((e,a)=>{o.push([e,t.studentCounts[a],parseFloat(t.percentages[a])])});var e=google.visualization.arrayToDataTable(o);new google.visualization.PieChart(r).draw(e,{legend:"none",pieSliceText:"label",pieStartAngle:100,slices:{0:{offset:.1},1:{offset:.1}},chartArea:{width:"90%",height:"90%"},width:800,height:400})}).catch(e=>console.error("Error loading data:",e))})}export{renderGoogleChart};